import React from 'react';
import "../Styles/accueil.css"
function Projets() {
  return (
    <div>
      <h2>Accueil</h2>
      <p>Je suis une élève ingénieur en informatique passionnée par la résolution de problèmes et la création de nouvelles solutions. 
        J'ai acquis des connaissances en développement de logiciels,
         en programmation informatique et en analyse de données. 
         Je suis capable de travailler en équipe et d'apprendre rapidement.
          Je suis toujours à la recherche de nouvelles opportunités pour développer mes compétences et suis désireuse de relever de nouveaux défis.
           Mes compétences incluent la programmation en plusieurs langues, la résolution de problèmes et l'analyse de données. 
    Je crois fermement que ma passion pour la technologie et mon désir de progresser peuvent apporter une valeur ajoutée à n'importe quel rôle informatique.</p>
    </div>
  );
}

export default Projets;
